  `cfg_is_float` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '[\"alipay\",\"wxpay\",\"tenpay\"]' COMMENT '使用小数识别订单的支付类型',
  `cfg_is_remittance` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '[\"alipay\",\"tenpay\"]' COMMENT '是否开启手动转账',
  `cfg_is_write_note` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '强制使用任意金额输入金额或备注',
  `cfg_paytype_order` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '{\"alipay\":1,\"wxpay\":1,\"tenpay\":1}' COMMENT '支付开关和排序',
  `cfg_is_open_users` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否启用多账号收款',
  `cfg_users_toggle` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '{\"alipay\":{\"toggle\":1},\"wxpay\":{\"toggle\":1},\"tenpay\":{\"toggle\":1}}' COMMENT '多账号收款切换方式 1=轮换 2=随机',
  `cfg_users_toggle_next` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '{\"alipay\":{\"next\":0},\"wxpay\":{\"next\":0},\"tenpay\":{\"next\":0}}' COMMENT '下一个收款账号',
  `cfg_qrcode_path` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收款码目录',
  `cfg_time` bigint(16) NOT NULL DEFAULT 0 COMMENT '修改时间',
  PRIMARY KEY (`cfg_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '配置表' ROW_FORMAT = Dynamic;

